import { css } from '@emotion/react';
import UserRow from './UserRow';

const divStyle = css`
  display: flex;
  flex-flow: column;
  align-items: center;
`;

const leaderboardWrapperStyle = css``;

const IndividualLeaderboard = () => {
  return (
    <div css={divStyle}>
      <div css={leaderboardWrapperStyle}>
        <UserRow />
        <UserRow />
        <UserRow />
        <UserRow />
        <UserRow />
        <UserRow />
      </div>
    </div>
  );
};

export default IndividualLeaderboard;
